function Aside({title}) {
    const style = {
        backgroundColor: '#112941',
        color: 'white',
        display: 'flex'
    };
    return (
        <aside style={style}>
            <nav>
                <ul>
                    <li><a href="#">Home</a></li>
                    <li><a href="#">About</a></li>
                    <li><a href="#">Interesting Things</a></li>
                    <li><a href="#">Boring Things</a></li>
                    <li><a href="#">Contact</a></li>
                </ul>
            </nav>
            <div>
                <p>{title}</p>
            </div>
        </aside>
    )
}
export default Aside;
